      products: data.products,
      size: "",
      sort: "",
    };
     }
  render() {
    return (
      <div className="grid-container">
        <header> <a href="/">React Shopping Cart</a> </header>
        <main>
          <div className="content">
            <div className="main">
              Product
            </div>
          </div>
          <div className="sidebar">
            Cart Items
          </div>
        </main>
        <footer> All right is reserved.</footer>


      </div>
    );
  }
}

export default App;
